import React from "react";
import { Link } from "react-router-dom";
import styles from "./FormBar.module.css";

const FormBar = () => {
  return (
    <div>
      <h1>this is PageOne</h1>
      <ul>
        <li>
          <Link to="./members/a">Log in</Link>
        </li>
      </ul>
      <ul>
        <li>
          <Link to="./newMember/a">Sign in</Link>
        </li>
      </ul>
    </div>
  );
};

export default FormBar;
